/*
 * alive 값이 1이면 각 스레드는 무한 루프를 돌며 반복해서 일을 하고,
 * alive 값이 0이 되면 무한 루프를 빠져나와 스레드를 자연스럽게 종료한다.
 */
int alive = 1;


pthread_mutex_t mutex; 
pthread_cond_t reader_cond; //reader가 cs에 들어갈 수 없을떄 기다리는 조건변수
pthread_cond_t writer_cond; //writer가 cs에 들어갈 수 없을때 기다리는 조건변수
int reader_count = 0; //진행되는 reader의 수
int reader_wait = 0;  //기다리는 reader의 수
int writer_count = 0;   //진행되는 writer의 수

/*
 * Reader 스레드는 같은 문자를 L0번 출력한다. 예를 들면 <AAA...AA> 이런 식이다.
 * 출력할 문자는 인자를 통해 0이면 A, 1이면 B, ..., 등으로 출력하며, 시작과 끝을 <...>로 나타낸다.
 * 단일 reader라면 <AAA...AA>처럼 같은 문자만 출력하겠지만, critical section에서 reader의
 * 중복을 허용하기 때문에 reader가 많아지면 출력이 어지럽게 섞여서 나오는 것이 정상이다.
 */
void *reader(void *arg)
{
    int id, i;

    /*
     * 들어온 인자를 통해 출력할 문자의 종류를 정한다.
     */
    id = *(int *)arg;
    /*
     * 스레드가 살아 있는 동안 같은 문자열 시퀀스 <XXX...XX>를 반복해서 출력한다.
     */
    while (alive) {
        pthread_mutex_lock(&mutex); //공유변수를 조회하기위한 락
        reader_wait++;
        while (writer_count == 1) { //reader가 임계구역에 들어갈 수 있지 확인
            pthread_cond_wait(&reader_cond, &mutex); //만족하지않으면 reader_cond에서 대기
        }
        ++reader_count;
        --reader_wait;
        pthread_mutex_unlock(&mutex);
        /*
         * Begin Critical Section
         */
        printf("<");
        for (i = 0; i < L0; ++i)
            printf("%c", 'A'+id);
        printf(">");
        /* 
         * End Critical Section
         */
        pthread_mutex_lock(&mutex); //공유변수 조사
        --reader_count;
        if (reader_count == 0) //reader를 마치고 writer에 신호를 준다.
            pthread_cond_signal(&writer_cond);
        pthread_mutex_unlock(&mutex);
    }
    pthread_exit(NULL);
}

/*
 * Writer 스레드는 어떤 사람의 얼굴 이미지를 출력한다.
 * 이미지는 여러 종류가 있으며 인자를 통해 식별한다.
 * Writer가 critical section에 있으면 다른 writer는 물론이고 어떠한 reader도 들어올 수 없다.
 * 만일 이것을 어기고 다른 writer나 reader가 들어왔다면 얼굴 이미지가 깨져서 쉽게 감지된다.
 */
void *writer(void *arg)
{
    int id, i;
    struct timespec req;
    /*
     * 들어온 인자를 통해 얼굴 이미지의 종류를 정한다.
     * 랜덤 생성기의 시드 값을 현재 시간으로 초기화한다.
     */
    id = *(int *)arg;
    srand(time(NULL));
    /*
     * 스레드가 살아 있는 동안 같은 이미지를 반복해서 출력한다.
     */
    while (alive) {
       pthread_mutex_lock(&mutex); //공유변수 조사
        while (reader_count > 0 || writer_count == 1) //writer가 CS를 실행할 수 있는지 검사
            pthread_cond_wait(&writer_cond, &mutex);  //만족하지 않으면 writer_cond에서 대기
        ++writer_count;
        pthread_mutex_unlock(&mutex);
        /*
         * Begin Critical Section
         */
        printf("\n");
        switch (id) {
            case 0:
                for (i = 0; i < L1; ++i)
                    printf("%s\n", img1[i]);
                break;
            case 1:
                for (i = 0; i < L2; ++i)
                    printf("%s\n", img2[i]);
                break;
            case 2:
                for (i = 0; i < L3; ++i)
                    printf("%s\n", img3[i]);
                break;
            case 3:
                for (i = 0; i < L4; ++i)
                    printf("%s\n", img4[i]);
                break;
            case 4:
                for (i = 0; i < L5; ++i)
                    printf("%s\n", img5[i]);
                break;
            default:
                ;
        }
        /* 
         * End Critical Section
         */
        /*
         * 이미지 출력 후 SLEEPTIME 나노초 안에서 랜덤하게 쉰다.
         */
        req.tv_sec = 0;
        req.tv_nsec = rand() % SLEEPTIME;
        nanosleep(&req, NULL);
        pthread_mutex_lock(&mutex); //공유변수 조사
        --writer_count;
        if (reader_wait > 0) //기다리고있는 reader가 있으면 모든reader를 깨운다
            pthread_cond_broadcast(&reader_cond);
        else
            pthread_cond_signal(&writer_cond); //그렇지않으면 기다리는writer를 깨운다.
        pthread_mutex_unlock(&mutex);
    }
    pthread_exit(NULL);
}
/*
 * 메인 함수는 NREAD 개의 reader 스레드를 생성하고, NWRITE 개의 writer 스레드를 생성한다.
 * 생성된 스레드가 일을 할 동안 0.2초 동안 기다렸다가 alive의 값을 0으로 바꿔서 모든 스레드가
 * 무한 루프를 빠져나올 수 있게 만든 후, 스레드가 자연스럽게 종료할 때까지 기다리고 메인을 종료한다.
 */
int main(void)
{
    int i;
    int rarg[NREAD], warg[NWRITE];
    pthread_t rthid[NREAD];
    pthread_t wthid[NWRITE];
    struct timespec req;

    pthread_mutex_init(&mutex, NULL);       //초
    pthread_cond_init(&reader_cond, NULL);  //기
    pthread_cond_init(&writer_cond, NULL);  //화
    /*
     * Create NREAD reader threads
     */
    for (i = 0; i < NREAD; ++i) {
        rarg[i] = i;
        if (pthread_create(rthid+i, NULL, reader, rarg+i) != 0) {
            fprintf(stderr, "pthread_create error\n");
            exit(-1);
        }
    }
    /* 
     * Create NWRITE writer threads
     */
    for (i = 0; i < NWRITE; ++i) {
        warg[i] = i;
        if (pthread_create(wthid+i, NULL, writer, warg+i) != 0) {
            fprintf(stderr, "pthread_create error\n");
            exit(-1);
        }
    }
    /* 
     * Wait for RUNTIME nanoseconds while the threads are working
     */
    req.tv_sec = 0;
    req.tv_nsec = RUNTIME;
    nanosleep(&req, NULL);
    /*
     * Now terminate all threads and leave
     */
    alive = 0;
    for (i = 0; i < NREAD; ++i)
        pthread_join(rthid[i], NULL);
    for (i = 0; i < NWRITE; ++i)
        pthread_join(wthid[i], NULL);
    exit(0);
}
